import axios from 'axios';

const saveForm = async (formData) => {
  try {
    const response = await axios.post('/api/save-form', formData);
    console.log(response.data);
  } catch (error) {
    console.error(error);
  }
};

const getForms = async () => {
  try {
    const response = await axios.get('/api/get-forms');
    console.log(response.data);
  } catch (error) {
    console.error(error);
  }
};
